import React from 'react'
import {Switch} from '@blueprintjs/core'



const DarkToggle = () => {
    return(
        <div>
            <Switch onClick={this.props.click}/>
            <b onClick={this.props.click} >Dark Mode</b>
        </div>
    );
}

export default DarkToggle;
